    <script>
        $(document).ready(function(){
            
            $('body').on('click','.get-more-game',function(e){
                e.preventDefault();
                var page = $(this).data('page');
                $.ajax({
                    url: '{{ route('api.getGame') }}',
                    method: 'get',
                    data: { page: page },
                    dataType: 'json',
                    success: function(res)
                    {
                        $('.get-more-game').data('page', page + 1);

                        if(res.error == 0)
                        {
                            let html = ``;
                            let data = res.data;
                            $.each(data,function(k,val){
                                html += `<div class="item-game">
                                            <div class="bg-game" style="background-image: url(${ val.thumbnail });"></div>
                                            <div class="visible-content">
                                                <div class="info-game">
                                                    ${ val.description }
                                                </div>
                                                <div class="name">${ val.name }</div>
                                            </div>
                                            <div class="hidden-content">
                                                <div class="icon-game">
                                                    <img src="${ val.icon }" alt="game-name" />
                                                </div>
                                                <div class="qr-game">
                                                    <img src="${ val.qr_code }" alt="game-name" />
                                                </div>
                                            </div>
                                            <a href="${ val.link }" class="btn-home">Trang chủ</a>
                                        </div>`;
                            })

                            $('.list-game').append(html)
                        }
                    }
                })
            })
           
        })    
    </script>   
@endsection